import React from 'react'
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';


const Exercise = () => {
	return (
		<div>
			<Grid container>
			<Paper>
				<Grid item sm>
					Left Pane
				</Grid>
			</Paper>
			<Paper>
				<Grid item sm>
					Right Pane
				</Grid>
			</Paper>
			</Grid>
		</div>
		)
} 

export default Exercise;
